import React from 'react';

const headingCont = {
    fontSize: '4vw',
}

const textCont = {
    fontSize: '2vw',
    lineHeight: '3vw',
}

function BasicInfoBlock(props) {

    return (
        <div className="basicInfoBlock">
            <h1 style={ headingCont }> 
                {props.heading || 'headingContent Required'} 
            </h1>
            <div style={ textCont }>
                {props.text || 'textContent Required'}
            </div>
        </div>
    );
}

export default BasicInfoBlock;
